import React, { Component } from 'react';
import { Switch, Route } from 'react-router';
import HomePage from './components/HomePage';

class App extends Component {
  render() {
    return (
      <div>
        <HomePage/>
        <Switch>
          <Route/>
        </Switch>

      </div>
    );
  }
}

export default App;
